function ListForm(){
    return (
        <form>
            <label>Write your new food</label>
            <textarea 
                placeholder="Text to writer "
            />
            <button
                className="ListForm-button ListForm-button--cancel "
            >
                Cancel
            </button>
            <button
                className="ListForm-button ListForm-button--add"
            >
                Add
            </button>
        </form>
    );
}

export { ListForm };
